import { exp } from "prelude-ls";
import React from "react";
import Avatar from "./Avatar";
import Detail from "./Detail";
import './card.css';

function Card(props){
return (
    <div>
       <dl>
        <div className="card">
            <div className="top">
            <dt>
                <h2 className="name">{props.name}</h2></dt>
                <Avatar img={props.img}/>
            </div>
            <div className="bottom">
              <dl></dl><Detail 
                detailInfo={props.quote}
               />
             
                
            </div>
        </div>
        </dl>
    </div>
);
}

export default Card;
